import React from 'react';
import css from 'AvatarImagem.module.css';

export default function AvatarImage(props) {
  const size = props.size || 'medium';

  if (!props.user) {
    return <img src="/img/default.png" />;
  }

  return <img src={`/img/${props.user}.png`} />;
}

